import './App.css';
import { useState } from 'react';

function App() {
  const [inputValue, setInput]=useState('');
  const changeInputValue=(event)=>{
    setInput(event.target.value);
  }
  return (
    <div className="App">
      <input type='text' onChange={changeInputValue}></input>
      {inputValue}
    </div>
  );
}


export default App;
